  useEffect(() => {
    // Fetch data from Express server
    axios.get('http://localhost:5000/api/data')
      .then(response => {
        console.log(response.data);
        setData(response.data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
<div>
      <h1 className="title">VIM</h1>
      <hr></hr>
        <table>
          <thead>
            <tr>
              <th>Material</th>
              <th>Grade</th>
              <th>Thickness</th>
              <th>Comments</th>
              <th>Image</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index}>
                <td className="firstCol">{index+1}</td>
                <td>{item.material}</td>
                <td>{item.grade}</td>
                <td>{item.thickness}</td>
                <td>{item.comments}</td>
                <td><img src={item.image_url}/>
                <button onClick={()=>{ window.locationitem.image_url}}>View</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
    </div>
  );
}

